import React, { useEffect } from "react";
import Board from "../board";
import useAutoScroll from "../../hooks/AutoScrollHook";
import { Button, TextField, Box, title } from "@mui/material";

function Play() {
    const scrollRef = useAutoScroll();
    useEffect(() => {
        document.title = "OXO - Play";
    }, []);
    
    return (
        <Box>
            <title>Play Tic-Tac-Toe</title>
            <div ref={scrollRef}>
            <Board/>
            </div>
        </Box>
    );
}

export default Play;
